import React from 'react';

const Profile = ({ info }) => {
    return (
        <div>
            <p>{ info.firstName }</p>
            <p>{ info.lastName }</p>
            <p>{ info.email }</p>
            <p>{ info.favSeason }</p>
        </div>
    );
}

export default Profile;
